  false,\n\t\"url\": null,\n\t\"notes\": \"This plan is established to provide a framework
  for surveillance, monitoring and disease response to Chronic Wasting Disease at
  the Eastern Virginia Rivers National Wildlife Refuge Complex in collaboration with
  the Virginia Department of Game and Inland Fisheries. Surveillance and response
  to Chronic Wasting Disease may involve active management of habitat, public use,
  and animal populations, including lethal collection of white-tailed deer and herd
  reduction.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
